import React from 'react';

const Navbar = () => {
  return (
    <>
    <nav class="navbar bg-body-tertiary">
    <div class="container-fluid">
        <a class="navbar-brand" href="#">Navbar</a>
    </div>
    </nav>

    <nav class="navbar bg-body-tertiary">
    <div class="container-fluid">
        <span class="navbar-brand mb-0 h1">Navbar</span>
    </div>
    </nav>
    </>
  );
};

export default Navbar;
